import React from "react";

function Navigation() {
  return (
    <div className="nav">
      <img src="images/peris2.jpg" alt="Code" className="profile" /> Peris
      <a href="#home">Portfolio</a>
      <a href="#projects">Projects</a>
      <a href="#about">About</a>
      <a href="#contact">Contact</a>
     
        </div>
     
  );
}
export default Navigation;
